public static void main(String[] args) {
    SpringApplication.run(FavouriteServiceApplication.class, args);
}

public static FavouriteDto map(final Favourite favourite) {
    return FavouriteDto.builder().userId(favourite.getUserId()).productId(favourite.getProductId()).likeDate(favourite.getLikeDate()).userDto(UserDto.builder().userId(favourite.getUserId()).build()).productDto(ProductDto.builder().productId(favourite.getProductId()).build()).build();
}

public static Favourite map(final FavouriteDto favouriteDto) {
    return Favourite.builder().userId(favouriteDto.getUserId()).productId(favouriteDto.getProductId()).likeDate(favouriteDto.getLikeDate()).build();
}

@Bean
public ObjectMapper objectMapperBean() {
    return new JsonMapper().enable(SerializationFeature.INDENT_OUTPUT);
}

@Override
public List<FavouriteDto> findAll() {
    log.info("*** FavouriteDto List, service; fetch all favourites *");
    return this.favouriteRepository.findAll().stream().map(FavouriteMappingHelper::map).map(f -> {
        f.setUserDto(this.restTemplate.getForObject(AppConstant.DiscoveredDomainsApi.USER_SERVICE_API_URL + "/" + f.getUserId(), UserDto.class));
        f.setProductDto(this.restTemplate.getForObject(AppConstant.DiscoveredDomainsApi.PRODUCT_SERVICE_API_URL + "/" + f.getProductId(), ProductDto.class));
        return f;
    }).distinct().collect(Collectors.toUnmodifiableList());
}

@Override
public FavouriteDto findById(final FavouriteId favouriteId) {
    log.info("*** FavouriteDto, service; fetch favourite by id *");
    return this.favouriteRepository.findById(favouriteId).map(FavouriteMappingHelper::map).map(f -> {
        f.setUserDto(this.restTemplate.getForObject(AppConstant.DiscoveredDomainsApi.USER_SERVICE_API_URL + "/" + f.getUserId(), UserDto.class));
        f.setProductDto(this.restTemplate.getForObject(AppConstant.DiscoveredDomainsApi.PRODUCT_SERVICE_API_URL + "/" + f.getProductId(), ProductDto.class));
        return f;
    }).orElseThrow(() -> new FavouriteNotFoundException(String.format("Favourite with id: [%s] not found!", favouriteId)));
}

@Override
public FavouriteDto save(final FavouriteDto favouriteDto) {
    return FavouriteMappingHelper.map(this.favouriteRepository.save(FavouriteMappingHelper.map(favouriteDto)));
}

@Override
public FavouriteDto update(final FavouriteDto favouriteDto) {
    return FavouriteMappingHelper.map(this.favouriteRepository.save(FavouriteMappingHelper.map(favouriteDto)));
}

@Override
public void deleteById(final FavouriteId favouriteId) {
    this.favouriteRepository.deleteById(favouriteId);
}

@LoadBalanced
@Bean
public RestTemplate restTemplateBean() {
    return new RestTemplate();
}

@GetMapping
public ResponseEntity<DtoCollectionResponse<FavouriteDto>> findAll() {
    log.info("*** FavouriteDto List, controller; fetch all favourites *");
    return ResponseEntity.ok(new DtoCollectionResponse<>(this.favouriteService.findAll()));
}

@GetMapping("/{userId}/{productId}/{likeDate}")
public ResponseEntity<FavouriteDto> findById(@PathVariable("userId") final String userId, @PathVariable("productId") final String productId, @PathVariable("likeDate") final String likeDate) {
    log.info("*** FavouriteDto, resource; fetch favourite by id *");
    return ResponseEntity.ok(this.favouriteService.findById(new FavouriteId(Integer.parseInt(userId), Integer.parseInt(productId), LocalDateTime.parse(likeDate, DateTimeFormatter.ofPattern(AppConstant.LOCAL_DATE_TIME_FORMAT)))));
}

@GetMapping("/find")
public ResponseEntity<FavouriteDto> findById(@RequestBody @NotNull(message = "Input must not be NULL") @Valid final FavouriteId favouriteId) {
    log.info("*** FavouriteDto, resource; fetch favourite by id *");
    return ResponseEntity.ok(this.favouriteService.findById(favouriteId));
}

@PostMapping
public ResponseEntity<FavouriteDto> save(@RequestBody @NotNull(message = "Input must not be NULL") @Valid final FavouriteDto favouriteDto) {
    log.info("*** FavouriteDto, resource; save favourite *");
    return ResponseEntity.ok(this.favouriteService.save(favouriteDto));
}

@PutMapping
public ResponseEntity<FavouriteDto> update(@RequestBody @NotNull(message = "Input must not be NULL") @Valid final FavouriteDto favouriteDto) {
    log.info("*** FavouriteDto, resource; update favourite *");
    return ResponseEntity.ok(this.favouriteService.update(favouriteDto));
}

@DeleteMapping("/{userId}/{productId}/{likeDate}")
public ResponseEntity<Boolean> deleteById(@PathVariable("userId") final String userId, @PathVariable("productId") final String productId, @PathVariable("likeDate") final String likeDate) {
    log.info("*** Boolean, resource; delete favourite by id *");
    this.favouriteService.deleteById(new FavouriteId(Integer.parseInt(userId), Integer.parseInt(productId), LocalDateTime.parse(likeDate, DateTimeFormatter.ofPattern(AppConstant.LOCAL_DATE_TIME_FORMAT))));
    return ResponseEntity.ok(true);
}

@DeleteMapping("/delete")
public ResponseEntity<Boolean> deleteById(@RequestBody @NotNull(message = "Input must not be NULL") @Valid final FavouriteId favouriteId) {
    log.info("*** Boolean, resource; delete favourite by id *");
    this.favouriteService.deleteById(favouriteId);
    return ResponseEntity.ok(true);
}

@ExceptionHandler(value = { MethodArgumentNotValidException.class, HttpMessageNotReadableException.class })
public <T extends BindException> ResponseEntity<ExceptionMsg> handleValidationException(final T e) {
    log.info("**ApiExceptionHandler controller, handle validation exception*\n");
    final var badRequest = HttpStatus.BAD_REQUEST;
    return new ResponseEntity<>(ExceptionMsg.builder().msg("*" + e.getBindingResult().getFieldError().getDefaultMessage() + "!**").httpStatus(badRequest).timestamp(ZonedDateTime.now(ZoneId.systemDefault())).build(), badRequest);
}

